- input: "TEXT\x1CC00081802\x1C.TEXT\x1C\x1CF3XA\x1CThis report is amended due to
    a letter from the Federal Election Commission inquiring about contributions to
    \ the WVRSEC from organizations that are not registered with the commission-specifically,
    contributions from 9 different West Virginia county party organizations and 3
    candidate compaign committees.  Under West Virginia state law, all money flowing
    into such organizations qualifies as clean money with respect to federal campaign
    finance law.  See WV Code ANN3-8-8(a), 3-8-12(i).  As such, any contributions
    received by the WVRSEC from these county party organizations fall within the limits
    and prohibitions of the Federal Election Campaign Act.  This report also amended
    to address other inquiries in Federal Election Commission letter dated March 19,2008"
